import './App.css';
import {Route, Switch} from 'react-router-dom';
import Home from './Components/Home/Home';
import Signup from './Components/Signup/Signup';

function App() {
  return (
    <>
    <Switch>
      <Route path='/' component={Home} />
      <Route path='/Signup' component={Signup} />
    </Switch>
    </>
  );
}

export default App;
